import PostForm from '../PostForm/PostForm'
import Posts from '../PostList/PostList'

export default class PostPage extends Component {
    render() {
        return (
            <div className="post">
                <PostForm />
                <hr />
                <Posts propFromParent={7} />
            </div>
        )
    }
}
